import React, { useState, useEffect } from 'react';
import axios from 'axios';

const LabTestManager = () => {
  const [labTests, setLabTests] = useState([]);
  const [newTest, setNewTest] = useState({ testName: '', description: '', price: '' });
  const [editingTest, setEditingTest] = useState(null);

  useEffect(() => {
    fetchLabTests();
  }, []);

  const fetchLabTests = async () => {
    try {
      const response = await axios.get('http://localhost:3000/labtests');
      setLabTests(response.data.data);
    } catch (error) {
      console.error('Error fetching lab tests:', error);
    }
  };

  const createLabTest = async () => {
    try {
      const response = await axios.post('http://localhost:3000/labtests', newTest);
      setLabTests([...labTests, response.data.data]);
      setNewTest({ testName: '', description: '', price: '' });
    } catch (error) {
      console.error('Error creating lab test:', error);
    }
  };

  const updateLabTest = async (id) => {
    try {
      const response = await axios.put(`http://localhost:3000/labtests/${id}`, editingTest);
      setLabTests(labTests.map(test => (test._id === id ? response.data.data : test)));
      setEditingTest(null);
    } catch (error) {
      console.error('Error updating lab test:', error);
    }
  };

  const deleteLabTest = async (id) => {
    try {
      await axios.delete(`http://localhost:3000/labtests/${id}`);
      setLabTests(labTests.filter(test => test._id !== id));
    } catch (error) {
      console.error('Error deleting lab test:', error);
    }
  };

  return (
    <div>
      <h2>Lab Tests</h2>
      <div>
        <input
          type="text"
          placeholder="Test Name"
          value={newTest.testName}
          onChange={(e) => setNewTest({ ...newTest, testName: e.target.value })}
        />
        <input
          type="text"
          placeholder="Description"
          value={newTest.description}
          onChange={(e) => setNewTest({ ...newTest, description: e.target.value })}
        />
        <input
          type="number"
          placeholder="Price"
          value={newTest.price}
          onChange={(e) => setNewTest({ ...newTest, price: e.target.value })}
        />
        <button onClick={createLabTest}>Add Lab Test</button>
      </div>

      <div>
        {labTests.map((test) => (
          <div key={test._id}>
            {editingTest && editingTest._id === test._id ? (
              <div>
                <input
                  type="text"
                  value={editingTest.testName}
                  onChange={(e) => setEditingTest({ ...editingTest, testName: e.target.value })}
                />
                <input
                  type="text"
                  value={editingTest.description}
                  onChange={(e) => setEditingTest({ ...editingTest, description: e.target.value })}
                />
                <input
                  type="number"
                  value={editingTest.price}
                  onChange={(e) => setEditingTest({ ...editingTest, price: e.target.value })}
                />
                <button onClick={() => updateLabTest(test._id)}>Save</button>
                <button onClick={() => setEditingTest(null)}>Cancel</button>
              </div>
            ) : (
              <div>
                <p>Test Name: {test.testName}</p>
                <p>Description: {test.description}</p>
                <p>Price: {test.price}</p>
                <button onClick={() => setEditingTest(test)}>Edit</button>
                <button onClick={() => deleteLabTest(test._id)}>Delete</button>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
};

export default LabTestManager;
